import { forwardRef } from 'react';

const Menu = forwardRef((props, ref) => {
  return (
    <div id='menu' ref={ref}>
      <div>
        <a href='catalog'>Philosophers of Religion</a>
      </div>
      <div>
        <a href='inner-life'>Inner Religious Life</a>
      </div>
      <div>
        <a href='outer-life'>Outer Religious Life</a>
      </div>
    </div>
  );
});

export default Menu;
